import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [restaurantData, setRestaurantData] = useState(null);

  // Call your FastAPI backend endpoint using axios
  useEffect(() => {
    async function fetchRestaurantData() {
      try {
        // Replace with the actual FastAPI endpoint URL
        const response = await axios.get('http://127.0.0.1:8000/restaurant/some-endpoint');

        // Set the response data to state
        setRestaurantData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    }

    fetchRestaurantData();
  }, []);  // Runs once when the component mounts

  return (
    <div className="App">
      <h1>What food would you like to eat?</h1>

      {restaurantData ? (
        <div>
          <h2>Restaurant Data:</h2>
          <pre>{JSON.stringify(restaurantData, null, 2)}</pre>
        </div>
      ) : (
        <p>Loading restaurant data...</p>
      )}
    </div>
  );
}

export default App;
